// src/components/ListItem.js
import React from 'react';
import styled from 'styled-components';

const ItemContainer = styled.div`
  background-color: #333;
  color: #fff;
  padding: 10px;
  margin: 5px 0;
  border-radius: 5px;
  display: flex;
  justify-content: space-between;
  cursor: pointer;

  &:hover {
    background-color: #444;
  }
`;

